const mpActionsType = {
    addUser: (state, action) => {
        return {...state, usuario: action.userName}
    }
}

export const spotifyConnection = (state = {usuario: "no user"}, action) =>{
    if(!mpActionsType[action.type]){
        return state
    }
    return mpActionsType[action.type](state, action)
}
